import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./home.module.css";

const Home = () => {
  const navigate = useNavigate();

  const onPath3Click = useCallback(() => {
    window.location.href = "mogyexpats.com";
  }, []);

  const onCreateAGameClick = useCallback(() => {
    navigate("/hostlobby"); // User wants to create a game - send them to the host page 
  }, [navigate]);


  return (
    <div className={styles.home}>
      <div className={styles.rectangleDiv} />
      <div className={styles.groupDiv}>
        <button className={styles.rectangleButton} autoFocus />
        <b className={styles.enter}>Enter</b>

      </div>
      <input className={styles.groupInput} type="text" placeholder="Game PIN" />
      <img
        className={styles.logo}
        alt=""
        src="../assets/logo.png"
      />

      <button className={styles.path3} onClick={onPath3Click} />
      <button className={styles.createAGame} onClick={onCreateAGameClick}>
        Create a game
      </button>
      <div>
      <b className={styles.testtext}>{te[0]}</b>
      </div>


      <div className={styles.login}>
        <div className={styles.rectangleDiv1} />
        <div className={styles.rectangleDiv2} />
        <div className={styles.login1}>Login</div>
        <div className={styles.register}>Register</div>
      </div>
    </div>
  );
};

export default Home;
